import List from './components/list'
import SignIn from './components/signIn'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (

    <div className="App">
    <Router>

      <Route path="/SignIn" element={<App />} />

    </Router>
    </div>

  );
}

export default App;
